replyComment:
@cheryl davison sadly - yes. In my country they say "if you go to court, you don't get justice, you just get a sentence." It is not the first and not the last incident of a "mis-trial". But those can get corrected. If the "old boys club" will get mixed up.
There are more jobs were "colleagues" decide upon possible mistakes. (In my country you have to complain to the doctor's club about a doctor.) That way it is hard to find good decisions. But for that reason lawmakers often instituted independent supervisory bodies. Government is really not the best answer, but sometimes it is needed. But we wanted the judiciary to be independent. Sometimes that is just not the case.
Nevertheless, justice and judges are being condemned right now (again), while Depp wins again in the "public" court and in the hearts of "normies" like me. (And I am not fond of ANY actor or their movies. I just feel pity for him - being abused by Ms Turd, the shill media AND the justice system over and over again.)
